class Solution {
public:
    vector<int> x;
    vector<int> callsorted(vector<int> &nums,int start,int end)
    {
        if(start>end)
        {
            return x;
        }
        int mid=(start+end)/2;
        x.push_back(nums[mid]);
        callsorted(nums,start,mid-1);
        callsorted(nums,mid+1,end);
        return x;
    }
    vector<int> sortedArrayToBST(vector<int>& nums) {
        // Code here
        return callsorted(nums,0,nums.size()-1);
    }
};

